import React from "react";
import { Tab, Tabs } from "react-bootstrap";
import { Container, Row, Col } from 'react-bootstrap';


function Player({ data }) {
  return (
    <div>
      <h2>Leage Admin Page</h2>
      <Tabs defaultActiveKey="home" id="admin-tabs" className="mb-3">
      <Tab eventKey="home" title="Home">
          <h3>Home Page</h3>
        </Tab>
        <Tab eventKey="player" title="Players">
          <PlayersInfo data={data}></PlayersInfo>
        </Tab>
      </Tabs>
    </div>
  );
}

function PlayersInfo({ data }) {
  return (
    <div>
      <h3>Your Details Below</h3>

            <div>
              <p>Name: {data.name}</p>
              <p>Team Name: {data.team}</p>
              <p>Your Average Score: {data.average_score}</p>
              <p>Number of games played: {data.games_participated}</p>
              </div>

    </div>
  );
}

export default Player;
